import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import HomeBanner from './images/seo.png'


//======================================== Home part start  =============================


export const Home_Banner_Left = (props) =>{
    return(
        <div className="col-lg-6">
        <div className="left">
            <div className="left_inner_content">
                <h5>{props.heading}</h5>
                <h1>{props.title}</h1>
                <p>{props.pera}</p>
                <div class="all-button slide-btn">
                <a href="#">explore</a>
                
                </div>
            </div>
        </div>
    </div>
    )
}


export const Home_Banner_Right = (props) =>{
    return(
        <div className="col-lg-6">
                            
        <div className="right" style={{ backgroundImage: `url(${require("./images/" +props.imgsrc)})`}}>
            
            </div>

    
    </div>
    )
}


export const Card_Five = (props) =>{
    return(
        <div className="col-lg-4 digital_main px-3">
        <div className="digital_part">
            <div className="digital_image">
            <img src={props.imgsrc} />
            </div>
            <div className="digital_text_content">
                <h4>{props.title}</h4>
                <p>{props.pera}</p>
                <div class="all-button">
                <Link className="nav-link dm" to="/services">know more</Link>
                </div>
            </div>
        </div>
    </div>
    )
}

export const Card_Six = (props) =>{
    return(
        <div className="col-lg-4">
        <div className="choose_inner m-1">
        <div className="choose_image">
        <img src={props.imgsrc} />
        </div>
        <div className="choose_text">
            <h4>{props.title}</h4>
            <p>{props.pera}</p>
        </div>
        </div>
    </div>
    )
}

export const Card_Seven = (props) =>{
    return(
        <div className="col-lg-3">
        <div className="card ">
            <div className="front">
            <img src={props.imgsrc} />
            </div>
            <div className="back">
                <div className="back-content ">
                    <h4>{props.title}</h4>
                    <a href={props.links_tw} target="_blank"><i class="fab fa-twitter tw" title="Twitter"></i></a>
                    <a href={props.links_fb} target="_blank"><i class="fab fa-facebook fb" title="Facebook"></i></a>
                    <a href={props.links_in} target="_blank"><i class="fab fa-instagram in" title="Instagram"></i></a>
                    <a href={props.links_ln} target="_blank"><i class="fab fa-linkedin-in ln" title="Linkedin"></i></a>

                </div>
            </div>

        </div>
    </div>
    )
}


//======================================== Home part End  =============================



//======================================== Service part start==========================
export const Card = (props) =>{
    return(
      
        <div className="col-lg-4 px-2">
                <div className="service_demo px-1">
                <div className="service_demo_image">
                <img src={props.imgsrc} />
                </div>
                <div className="service_demo_text">
                        <h4>{props.title}</h4>
                        <p>{props.pera}</p>
                </div>
                </div>
            </div>
            
    )
}


export const Card_Two = (props) =>{
    return(
        <div className="col-lg-4 px-2 mt-4">
        <div className="service_role_demo px-1">
        <div className="service_role_demo_image">
        <img src={props.imgsrc} />
        </div>
        <div className="service_role_demo_text">
            <h4>{props.title}</h4>
        </div>
        </div>
            </div>
    )
}

export const Card_Three = (props) =>{
    return(
        <div className="col-lg-3 px-2">
        <div className="data_demo px-1">
        <div className="service_demo_image">
        <img src={props.imgsrc} />
        </div>
        <div className="data_demo_text">
            <h4>{props.title}</h4>
          
        </div>
        </div>
    </div>
    )
}


export const Card_Nine_Left = (props) =>{
    return(
        <>
        
        <div className="col-lg-6">
        <div className="what_data_science">
            <div className="what_data_science_content">
                <h2>{props.l_title}</h2>
                <p>{props.l_pera}</p>
         
                    <h4><span><i class="far fa-hand-point-right"></i></span>{props.l_content_one}</h4>
                    <h4><span><i class="far fa-hand-point-right"></i></span>{props.l_content_two}</h4>
                    <h4><span><i class="far fa-hand-point-right"></i></span>{props.l_content_three}</h4>
              
            </div>
        </div>
    </div>        
    </>
    )
}



export const Card_Nine_Right = (props) =>{
    return(
        <>
        <div className="col-lg-6">
        <div className="data_science_role">
             <div className="data_science_role_content">
                 <h2>{props.r_title}</h2>
                 <p>{props.r_pera}</p>
               
                    <h4><span><i class="far fa-hand-point-right"></i></span>{props.r_content_one}</h4>
                    <h4><span><i class="far fa-hand-point-right"></i></span>{props.r_content_two}</h4>
                    <h4><span><i class="far fa-hand-point-right"></i></span>{props.r_content_three}</h4>
             
             </div>
        </div>
    </div>
        
        </>
    )
}
//======================================== Service part End  ============================






//======================================== Price part start  =============================
export const Card_Four = (props) =>{
    return(
        <div className="col-lg-4  px-3 my-2">
        <div className="price_main_content text-center">
            <div className="price_left_inner price_common">
                <div className="price_basic_head">
                <h4>{props.title_one}</h4>
                </div>
                <div className="price_content_image">
                <img src={props.imgsrc}  />
                </div>
                <div className="price_text_content text-center">
                    <h2><sup>$</sup>{props.title_two}<span><sub>/month</sub></span></h2>
                      <p>{props.pera_one}</p>
                      <p>{props.pera_two}</p>
                      <p>{props.pera_three}</p>
                      <p>{props.pera_four}</p>
                      <p>{props.pera_five}</p>
                </div>
                <div class="all-button">
            <Link className="nav-link dm" to="/contact">Contact now</Link>
            </div>
            </div>
        </div>
    </div>
    )
}


export const Card_Eight = (props) =>{
    return(
        <div className="col-lg-4 px-3">
            <div className="price_digital_content my-2">
                        <div className="price_service_image">
                           <img src={props.imgsrc} />
                        </div>
                <div className="price_digital_content_text">
                    <h4>{props.title}</h4>
                    <p>{props.pera}</p>
                </div>
            </div>
        </div>
    )
}


//======================================== Price part End  =============================



//======================================== Blog part Start  =============================

export const Blog_Left = (props) =>{
    return(
       <div {...props}>
            {props.children}
       </div>
    )
}
export const Blog_Right = (props) =>{
    return(
<div {...props}> {props.children}</div>
    )
}


//======================================== Blog part End  =============================
